delta_theta(:,i)=pinv(J_seven_layers)*delta_position(:,i);

% % 第一层动平台齐次变换矩阵
T01=[cos(theta(2,i)),sin(theta(2,i))*sin(theta(1,i)),sin(theta(2,i))*cos(theta(1,i));
    0,cos(theta(1,i)),-sin(theta(1,i));
    -sin(theta(2,i)),cos(theta(2,i))*sin(theta(1,i)),cos(theta(2,i))*cos(theta(1,i))];
% % 第二层动平台齐次变换矩阵
T12=[cos(theta(4,i)),sin(theta(4,i))*sin(theta(3,i)),sin(theta(4,i))*cos(theta(3,i));
    0,cos(theta(3,i)),-sin(theta(3,i));
    -sin(theta(4,i)),cos(theta(4,i))*sin(theta(3,i)),cos(theta(4,i))*cos(theta(3,i))];

A1_0=[-R/2;-sqrt(3)/2*R;0]; 
A2_0=[R;0;0]; 
A3_0=[-R/2;sqrt(3)/2*R;0];

B1_1=[-R/2;-sqrt(3)/2*R;0]; 
B2_1=[R;0;0]; 
B3_1=[-R/2;sqrt(3)/2*R;0];

B4_2=[-R/2;-sqrt(3)/2*R;0]; 
