B6_2=[-R/2;sqrt(3)/2*R;0];

P=[0;0;C_s];

% 当前构型下，动平台端点位置向量在全局坐标系下的描述
B1_0=T01*B1_1;
B2_0=T01*B2_1;
B3_0=T01*B3_1;

B4_1=T12*B4_2;
B5_1=T12*B5_2;
B6_1=T12*B6_2;

% 第一层的驱动杆的方向向量
