limb_vector2=B2_0+P-A2_0;
limb_vector3=B3_0+P-A3_0;

% 第二层的驱动杆的方向向量
limb_vector4=B4_1+P-B1_1;
limb_vector5=B5_1+P-B2_1;
limb_vector6=B6_1+P-B3_1;

% 第一层驱动杆单位向量
unit_vector1=limb_vector1/sqrt(limb_vector1'*limb_vector1);
unit_vector2=limb_vector2/sqrt(limb_vector2'*limb_vector2);
unit_vector3=limb_vector3/sqrt(limb_vector3'*limb_vector3);

